VisualFeaturesExtractor::VisualFeaturesExtractor() :it_(nh_)
{ }


bool VisualFeaturesExtractor::init(ros::NodeHandle &nh){

  nh_ = nh;

  cb_images_ptr_.reset (new cv_bridge::CvImage());
  in_images_ptr_.reset (new cv_bridge::CvImage());

  // Get base_name from parameter server
  if (!nh_.getParam("base_name", base_name_)){
    nh_.param("base_name", base_name_, std::string ("visual_features_extractor"));
    ROS_WARN("Parameter base_name was not found. Default name is used: %s ", base_name_.c_str());
  }

  // Get raw image topics from parameter server
  if (!nh_.getParam("raw_images_topic", raw_images_topic_)){
    nh_.param("raw_images_topics", raw_images_topic_, std::string ("/usb_cam/image_raw"));
    ROS_WARN("Parameter raw_images_topic was not found. Default topic's name is used: %s ", raw_images_topic_.c_str());
  }


  if (!nh_.getParam("using_sim_features", using_sim_features_)){
    nh_.param("using_sim_features", using_sim_features_, false);
    ROS_WARN("Parameter using_sim_features was not found. Default value is used: false");
  }

  if (!nh_.getParam("using_extended_features", using_extended_features_)){
    nh_.param("using_extended_features", using_extended_features_, false);
    ROS_WARN("Parameter using_extended_features was not found. Default value is used: false");
  }

  if (!nh_.getParam("using_symmetrical_features", using_symmetrical_features_)){
    nh_.param("using_symmetrical_features", using_symmetrical_features_, true);
    ROS_WARN("Parameter using_symmetrical_features was not found. Default value is used: false");
  }

  if (!nh_.getParam("extended_features_var", extended_features_var_)){
    nh_.param("extended_features_var", extended_features_var_, 1.0);
    ROS_WARN("Parameter extended_features_var was not found. Default value is used: %lf", extended_features_var_);
  }

  ROS_WARN("Parameter extended_features_var was not found. Default value is used: %lf", extended_features_var_);

  if (!nh_.getParam("using_colored_blobs", using_colored_blobs_)){
    nh_.param("using_colored_blobs", using_colored_blobs_, false);
    ROS_WARN("Parameter using_colored_blobs was not found. Default value is used: false");
  }

  if (!nh_.getParam("contour_area_threshold", min_contour_area_threshold_)){
    nh_.param("contour_area_threshold", min_contour_area_threshold_, 20.0);
    ROS_WARN("Parameter contour_area_threshold was not found. Default value is used: %lf", min_contour_area_threshold_);
  }

  if (using_colored_blobs_){
    XmlRpc::XmlRpcValue color_ranges;
    std::string blobs_param_name = std::string ("blobs_color_ranges");

    //Get all blobs_color_ranges from yaml
    if ( !nh_.getParam(nh_.getNamespace()+"/"+blobs_param_name, color_ranges ) || color_ranges.getType() != XmlRpc::XmlRpcValue::TypeArray)
      ROS_WARN("%s is not properly set in yaml file",blobs_param_name.c_str());
    num_extracted_features_ = 0;
    for (size_t i = 0; i < color_ranges.size(); i++){
      if ( color_ranges[i].getType() != XmlRpc::XmlRpcValue::TypeStruct)
        ROS_WARN("color_range[%ld] is not properly set in yaml file", i);
      else{
        // Check fields
        if ( !color_ranges[i].hasMember(std::string("h_min")) || !color_ranges[i].hasMember(std::string("h_max")))
          ROS_WARN("color_range[%ld] is not proceed, since not all keys are not found in yaml file.", i);
        else{
          hue_min_limits_.push_back(static_cast<int> (color_ranges[i][std::string("h_min")]));
          hue_max_limits_.push_back(static_cast<int> (color_ranges[i][std::string("h_max")]));
          num_extracted_features_++;
        }
      }
    }
  }
  else{
    XmlRpc::XmlRpcValue arucos_param;
    std::string aruco_param_name = std::string ("arucos_param");

    //Get all arucos_param from yaml
    if ( !nh_.getParam(nh_.getNamespace()+"/"+aruco_param_name, arucos_param ) || arucos_param.getType() != XmlRpc::XmlRpcValue::TypeArray)
      ROS_WARN("%s is not properly set in yaml file",aruco_param_name.c_str());

    num_extracted_features_ = 0;
    for (size_t i = 0; i < arucos_param.size(); i++){
      if ( arucos_param[i].getType() != XmlRpc::XmlRpcValue::TypeStruct)
        ROS_WARN("arucos_param[%ld] is not properly set in yaml file", i);
      else{
        // Check fields
        if ( !arucos_param[i].hasMember(std::string("id")) || !arucos_param[i].hasMember(std::string("size")))
          ROS_WARN("arucos_param[%ld] is not proceed, since not all keys are not found in yaml file.", i);
        else{
          arucos_id.push_back(static_cast<int> (arucos_param[i][std::string("id")]));
          arucos_size.push_back(static_cast<double> (arucos_param[i][std::string("size")]));
          num_extracted_features_++;
        }
      }
    }
  }

  // Get camera_name from parameter server
  if (!nh_.getParam("camera_name", camera_name_)){
    ROS_WARN("Parameter camera_name was not found");
    return false;
  }

  // Get camera parameter from parameter server
  if(!getCameraParameter(nh_, camera_name_, cam_param_))
    return false;
  else{
    aruco_cam_params_.CamSize.width = cam_param_.width;
    aruco_cam_params_.CamSize.height = cam_param_.height;

    aruco_cam_params_.CameraMatrix = cv::Mat::eye(3, 3, CV_32F);
    aruco_cam_params_.CameraMatrix.at<float>(0,0) = cam_param_.K[0];
    aruco_cam_params_.CameraMatrix.at<float>(1,1) = cam_param_.K[4];
    aruco_cam_params_.CameraMatrix.at<float>(0,2) = cam_param_.K[2];
    aruco_cam_params_.CameraMatrix.at<float>(1,2) = cam_param_.K[5];

    aruco_cam_params_.Distorsion = cv::Mat::zeros(1, 5, CV_32F);
    aruco_cam_params_.Distorsion.at<float>(0,0) = cam_param_.D[0];
    aruco_cam_params_.Distorsion.at<float>(0,1) = cam_param_.D[1];
    aruco_cam_params_.Distorsion.at<float>(0,2) = cam_param_.D[2];
    aruco_cam_params_.Distorsion.at<float>(0,3) = cam_param_.D[3];
    aruco_cam_params_.Distorsion.at<float>(0,4) = cam_param_.D[4];
  }

  // Initialize for the case with simulated features
  rect_image_ = cv::Mat::zeros(cam_param_.height, cam_param_.width, CV_8UC3);

  image_status_ = -1;
  safety_ton_image_.fromSec(-10.0);

  // ToDo from parameter server
  features_names_ = {"f1", "f2", "f3", "f4"};

  //Initializing
  x_.resize(num_extracted_features_);
  y_.resize(num_extracted_features_);

  //sim features wrt to ics world  default
  //    TFwsf_.setOrigin(tf::Vector3( 0.0,  1.50,  0.75));
  //    TFwsf_.setRotation(tf::createQuaternionFromRPY(M_PI_2,  0,  0));

  //sim features wrt to ics world (on bottom)
  //    TFwsf_.setOrigin(tf::Vector3( 0.0,  0.65,  0.0));
  //    TFwsf_.setRotation(tf::createQuaternionFromRPY( 0.0,  0,  0));

  //sim features wrt to ics world (on top)
  //    TFwsf_.setOrigin(tf::Vector3(0.0, 0.65, 2.5));
  //    TFwsf_.setRotation(tf::createQuaternionFromRPY(M_PI, 0, 0));

  //sim features wrt to ics world (on left)
  //    TFwsf_.setOrigin(tf::Vector3(1.25, 0.65, 1.25));
  //    TFwsf_.setRotation(tf::createQuaternionFromRPY(M_PI_2, 0, -M_PI_2));

  //sim features wrt to ics world (on right)
  //    TFwsf_.setOrigin(tf::Vector3(-1.25, 0.65, 1.25));
  //    TFwsf_.setRotation(tf::createQuaternionFromRPY(M_PI_2, 0, M_PI_2));

  // sim features wrt to hri world  default
  TFwsf_.setOrigin(tf::Vector3( 0.0,  -0.23,  0.78));
  TFwsf_.setRotation(tf::createQuaternionFromRPY(0,  0,  0));


  //Kept only for test
  TFwe_.setOrigin(tf::Vector3( 0.0297,  0.7406,  0.8944));
  TFwe_.setRotation(tf::Quaternion( 0.707106781,  0.707106781,  0.000,  0.000));


  simVisualFeaturesTFs();

  //desired features wrt to image  default in the center
  TFcdf_.setOrigin(tf::Vector3( 0.5 * cam_param_.width,  0.5 * cam_param_.height,  0.0));
  TFcdf_.setRotation(tf::createQuaternionFromRPY( 0.0,  0.0,  0.0));
  desVisualFeaturesTFs();

  // Initialize  image subsribers
  if (!using_sim_features_)
    sub_img_transport_= it_.subscribe(raw_images_topic_, 1, boost::bind(&VisualFeaturesExtractor::imageCB, this, _1, &cb_images_ptr_, &safety_ton_image_, &image_status_));

  // Initialize  publishers
  pub_vis_data_ = nh_.advertise<visual_features_extractor::VisFeature>(nh_.getNamespace()+"/visual_features_data", 10);

  // Initialize  services
  srv_set_sim_features_tf_ = nh_.advertiseService(nh_.getNamespace()+"/set_tf_sim_feature_wrt_world", &VisualFeaturesExtractor::setTfSimFeatureWrtWorld, this);
  srv_set_des_features_tf_ = nh_.advertiseService(nh_.getNamespace()+"/set_tf_des_feature_wrt_camera", &VisualFeaturesExtractor::setTfDesFeatureWrtCamera, this);
  srv_set_des_template_ = nh_.advertiseService(nh_.getNamespace()+"/set_desired_template", &VisualFeaturesExtractor::setDesiredTemplate, this);

  Z_des_ =0.54; // desired

  ROS_INFO ("VisualFeaturesExtractor with a name %s is initialized", base_name_.c_str());
  return true;
}

void VisualFeaturesExtractor::update(const ros::Time& time, const ros::Duration& period){


  Eigen::IOFormat CleanFmt(Eigen::StreamPrecision, Eigen::DontAlignCols, ", ", "\n", "[", "]");
  std::cout << std::fixed << std::setprecision(4);

  // Safety timers and image mutex
  {
    boost::lock_guard<boost::mutex> guard(image_cb_mutex_);
    if ((ros::Time::now()- safety_ton_image_).toSec()< 2.0 && image_status_> -1){ image_status_; }
    else if ((ros::Time::now()- safety_ton_image_).toSec()> 2.0 && image_status_> -1){ image_status_= 0; }
    if (image_status_ == 0 && !using_sim_features_) ROS_WARN("Image's topic is not longer available");
    else if (image_status_ == -1 && !using_sim_features_) ROS_WARN_THROTTLE(5, "Waiting for image's topic");
    in_images_ptr_ =cb_images_ptr_;
  }

  if (getTFs()){
    ros::Time tic = ros::Time::now();
    calcFeaturesImageCoord();
    std::vector<cv::Point2d> features_coord;
    std::vector<std::vector<cv::Point> > contours;
    std::vector<std::string> founded_features_names;
    std::vector<aruco::Marker>  markers;
    if (image_status_ ==1 && !using_sim_features_){
      tic = ros::Time::now();
      // Rectify the image
      if (!cam_param_.K.empty() && !cam_param_.D.empty()){
        cv::Mat1d cameraMatrix = (cv::Mat1d(3, 3) << cam_param_.K[0], 0, cam_param_.K[2], 0, cam_param_.K[4], cam_param_.K[5], 0, 0, 1);
        cv::Mat1d distCoeffs =   (cv::Mat1d(1, 5) << cam_param_.D[0], cam_param_.D[1], cam_param_.D[2], cam_param_.D[3], cam_param_.D[4]);
        cv::undistort(in_images_ptr_->image, rect_image_, cameraMatrix, distCoeffs);
      }

      if (using_colored_blobs_){
        // find the centren of the blobs
        findBlobsContours(rect_image_ , contours, founded_features_names);
        std::stringstream stream;
        for (size_t i = 0; i< contours.size(); i++){
          cv::Moments momensts = cv::moments( contours[i], false);
          cv::Point2d fc = cv::Point2d( momensts.m10/momensts.m00 , momensts.m01/momensts.m00);
          if (fc.x < cam_param_.width && fc.y < cam_param_.height){
            features_coord.push_back(fc);
            stream << founded_features_names[i]<< fixed << setprecision(4) << " ["<<fc.x<<"  " <<fc.y<<"]   ";
          }
          else
             stream << founded_features_names[i]<< " [ out of FOV ]   ";
        }
        ROS_DEBUG_STREAM ("Real features:" << stream.str() );
      }
      else{
        findArucoMarkers (in_images_ptr_->image , markers, founded_features_names);
        std::stringstream stream;
        for (size_t i = 0; i< markers.size(); i++){
          // find the center of the marker
          cv::Point2d fc = markers[i][0] + markers[i][1] + markers[i][2] + markers[i][3];
          fc = cv::Point2d(fc.x/4.0, fc.y/4.0);
          if (fc.x < cam_param_.width && fc.y < cam_param_.height){
            features_coord.push_back(fc);
            stream << founded_features_names[i]<< fixed << setprecision(4) << " ["<<fc.x<<"  " <<fc.y<<"]   ";
          }
          else
            stream << founded_features_names[i]<< " [ out of FOV ]   ";
        }
        ROS_DEBUG_STREAM ("Real features:" << stream.str() );
      }
    }
    else if(using_sim_features_)
      features_coord = sim_features_coord_;

    // Calculation for desired feature
    visual_feature_msg_.is_valid_des_feature = calcFeaturesParameters(des_features_coord_);
    mu02des_= mu02_;
    mu20des_ = mu20_;

    // Rotation based on P. Corke approach. Calculate the longest line segment betweeen point 0 and other points
    double max_dist =0.0;
    idx_max_dist_ = 1;
    for (size_t i = 1; i < des_features_coord_.size(); i++){
      cv::Point2d d = des_features_coord_[0] - des_features_coord_[i];
      if (max_dist < d.x * d.x + d.y * d.y){
        max_dist = d.x * d.x + d.y * d.y;
        idx_max_dist_ = i;
      }
    }

    if ( visual_feature_msg_.is_valid_des_feature) {
      des_angle_ = atan2((des_features_coord_[0].y - des_features_coord_[idx_max_dist_].y),
          (des_features_coord_[idx_max_dist_].x - des_features_coord_[0].x));
      alpha_ = des_angle_;

      // Calculation of feature vector and
      if (using_extended_features_ && using_symmetrical_features_){
        if (extended_features_var_==1.0)
          calcExtendedSymmetricalV1_0(s_des_, Lhat_des_);
        else if (extended_features_var_==1.1)
          calcExtendedSymmetricalV1_1(s_des_, Lhat_des_);
        else if (extended_features_var_==1.2)
          calcExtendedSymmetricalV1_2(s_des_, Lhat_des_);
        else if (extended_features_var_==1.3)
          calcExtendedSymmetricalV1_3(s_des_, Lhat_des_);
      }
      else if (using_extended_features_ && !using_symmetrical_features_){
        if (extended_features_var_==1.0)
          calcExtendedAsymmetricalV1_0(s_des_, Lhat_des_);
        else if (extended_features_var_==1.1)
          calcExtendedAsymmetricalV1_1(s_des_, Lhat_des_);
        else if (extended_features_var_==1.2)
          calcExtendedAsymmetricalV1_2(s_des_, Lhat_des_);
        else if (extended_features_var_==1.3)
          calcExtendedAsymmetricalV1_3(s_des_, Lhat_des_);
      }
      else
        calcSimple(s_des_, Lhat_des_);
      // Set common data
      visual_feature_msg_.size_s_des = s_des_.size();
      visual_feature_msg_.rowsLdes = Lhat_des_.rows();
      visual_feature_msg_.colsLdes = Lhat_des_.cols();
      visual_feature_msg_.s_des.resize(s_des_.size());
      visual_feature_msg_.L_data_des.resize(Lhat_des_.rows()*Lhat_des_.cols());
      // Set data for s message
      for(size_t i =0; i < s_des_.size(); i++)
        visual_feature_msg_.s_des[i] = s_des_[i];

      // Set data for L message
      for(int r =0; r < Lhat_des_.rows(); r++){
        for(int c =0; c < Lhat_des_.cols(); c++){
          visual_feature_msg_.L_data_des[r*Lhat_des_.cols() + c] = Lhat_des_(r, c);
        }
      }
      ROS_INFO ("The distance Z to the desired feature is %.4lf", Z_des_ );
      ROS_INFO_STREAM("s_des: "<< std::fixed << std::setprecision(5)<<s_des_.transpose().format(CleanFmt));
      ROS_DEBUG_STREAM("L_des: "<<"\n" << std::fixed << std::setprecision(4) << Lhat_des_.format(CleanFmt));
    }

    // Smoothing founded coordinates
    if (features_coord.size() == num_extracted_features_ && work_features_coord_.size()!= num_extracted_features_ )
      work_features_coord_ = features_coord;
    else if (features_coord.size()== num_extracted_features_ && work_features_coord_.size()== num_extracted_features_){
      for (size_t i =0; i<features_coord.size(); i++){
        work_features_coord_[i].x = filters::exponentialSmoothing(features_coord[i].x, work_features_coord_[i].x, 0.9);
        work_features_coord_[i].y = filters::exponentialSmoothing(features_coord[i].y, work_features_coord_[i].y, 0.9);
      }
    }
    else if (features_coord.size() != num_extracted_features_ )
      work_features_coord_ = features_coord;

    // Calculation for measured feature (real/sim)
    visual_feature_msg_.is_valid_msr_feature = calcFeaturesParameters(work_features_coord_);
    showAll(rect_image_, contours, markers, work_features_coord_, founded_features_names );
    if (visual_feature_msg_.is_valid_msr_feature){
      // Calculate angle between horizontal axis and
      msr_angle_ = atan2((work_features_coord_[0].y - work_features_coord_[idx_max_dist_].y),
          (work_features_coord_[idx_max_dist_].x - work_features_coord_[0].x));
      alpha_ = msr_angle_;
      // Calculation of feature vector and interaction matrix
      if (using_extended_features_ && using_symmetrical_features_){
        if (extended_features_var_==1.0)
          calcExtendedSymmetricalV1_0(s_msr_, Lhat_msr_);
        else if (extended_features_var_==1.1)
          calcExtendedSymmetricalV1_1(s_msr_, Lhat_msr_);
        else if (extended_features_var_==1.2)
          calcExtendedSymmetricalV1_1(s_msr_, Lhat_msr_);
        else if (extended_features_var_==1.3)
          calcExtendedSymmetricalV1_1(s_msr_, Lhat_msr_);
      }
      else if (using_extended_features_ && !using_symmetrical_features_){
        if (extended_features_var_==1.0)
          calcExtendedAsymmetricalV1_0(s_msr_, Lhat_msr_);
        else if (extended_features_var_==1.1)
          calcExtendedAsymmetricalV1_1(s_msr_, Lhat_msr_);
        else if (extended_features_var_==1.2)
          calcExtendedAsymmetricalV1_2(s_msr_, Lhat_msr_);
        else if (extended_features_var_==1.3)
          calcExtendedAsymmetricalV1_3(s_msr_, Lhat_msr_);
      }
      else
        calcSimple(s_msr_, Lhat_msr_);

      // Set common data
      visual_feature_msg_.size_s_msr = s_msr_.size();
      visual_feature_msg_.rowsLmsr = Lhat_msr_.rows();
      visual_feature_msg_.colsLmsr = Lhat_msr_.cols();
      visual_feature_msg_.s_msr.resize(s_msr_.size());
      visual_feature_msg_.L_data_msr.resize(Lhat_msr_.rows()*Lhat_msr_.cols());

      // Set data for s message
      for(size_t i =0; i < s_msr_.size(); i++)
        visual_feature_msg_.s_msr[i] = s_msr_[i];

      // Set data for L message
      for(int r =0; r < Lhat_msr_.rows(); r++){
        for(int c =0; c < Lhat_msr_.cols(); c++){
          visual_feature_msg_.L_data_msr[r*Lhat_msr_.cols() + c] = Lhat_msr_(r, c);
        }
      }
      ROS_INFO ("The distance Z to the measured feature is %.4lf", Z_ );
      ROS_INFO_STREAM("s_msr: "<<std::fixed << std::setprecision(5)<<s_msr_.transpose().format(CleanFmt));
      ROS_DEBUG_STREAM("L_msr: "<<"\n" <<std::fixed << std::setprecision(4)<<Lhat_msr_.format(CleanFmt));
      ROS_INFO("##################################################################");
    }
  }

  visual_feature_msg_.header.stamp = ros::Time::now();
  visual_feature_msg_.numFeatures = num_extracted_features_;
  pub_vis_data_.publish(visual_feature_msg_);

  // update time for simulated features TF
  for (size_t i = 0; i< allTFwff_.size(); i++)
    allTFwff_[i].stamp_ = ros::Time::now();
  br_.sendTransform (allTFwff_);
}


bool VisualFeaturesExtractor::setTfSimFeatureWrtWorld(
    visual_features_extractor::SetTF::Request &req,
    visual_features_extractor::SetTF::Response &res)
{

  TFwsf_.setOrigin(tf::Vector3(req.x, req.y, req.z));
  TFwsf_.setRotation(tf::createQuaternionFromRPY(req.roll, req.pitch, req.yaw));
  simVisualFeaturesTFs();
  res.set =true;
  return true;
}

bool VisualFeaturesExtractor::setTfDesFeatureWrtCamera(
    visual_features_extractor::SetTF::Request &req,
    visual_features_extractor::SetTF::Response &res)
{

  TFcdf_.setOrigin(tf::Vector3(req.x, req.y, req.z));
  TFcdf_.setRotation(tf::createQuaternionFromRPY(req.roll, req.pitch, req.yaw));
  desVisualFeaturesTFs();
  res.set =true;
  return true;
}

bool VisualFeaturesExtractor:: setDesiredTemplate(visual_features_extractor::SetDepth::Request &req,
                                                  visual_features_extractor::SetDepth::Response &res)
{

  tf::Transform TFcdf;
  std::vector<cv::Point2d> features_coord;
  std::vector<std::vector<cv::Point> > contours;
  std::vector<std::string> founded_features_names;
  std::vector<aruco::Marker>  markers;
  if (image_status_ ==1 && !using_sim_features_){
    if (using_colored_blobs_ ){
      findBlobsContours(rect_image_ , contours, founded_features_names);
      for (size_t i = 0; i< contours.size(); i++){
        cv::Moments momensts = cv::moments( contours[i], false);
        cv::Point2d fc = cv::Point2d( momensts.m10/momensts.m00 , momensts.m01/momensts.m00);
        features_coord.push_back(fc);
        std::cout << founded_features_names[i]<< " ["<<fc.x<<"  " <<fc.y<<"]   ";
      }
    }
    else {
      findArucoMarkers (in_images_ptr_->image , markers, founded_features_names);
      for (size_t i = 0; i< markers.size(); i++){
        // find the center of the marker
        cv::Point2d fc = markers[i][0] + markers[i][1] + markers[i][2] + markers[i][3];
        fc = cv::Point2d(fc.x/4, fc.y/4);
        features_coord.push_back(fc);
        std::cout << founded_features_names[i]<< " ["<<fc.x<<"  " <<fc.y<<"]   ";
      }
    }

    if(using_colored_blobs_ && features_coord.size() != hue_min_limits_.size())
      ROS_WARN ("Founded features are inconsistent");
    else if(!using_colored_blobs_ && features_coord.size() != arucos_id.size())
      ROS_WARN ("Founded features are inconsistent");
    else{
      ROS_WARN ("Founded features are ok");
      allTFcdf_.clear();
      for (size_t i = 0; i< features_coord.size(); i++){
        TFcdf.setOrigin(tf::Vector3(features_coord[i].x, features_coord[i].y, 0.0));
        TFcdf.setRotation(tf::createQuaternionFromRPY(0.0, 0.0, 0.0));
        allTFcdf_.push_back(TFcdf);
        Z_des_ = req.depth;
        res.set =true;
      }
    }
  }
  else if (!using_sim_features_)
    ROS_WARN ("There is not still a received image for templates");

  if(using_sim_features_){
    for (size_t i = 0; i< sim_features_coord_.size(); i++){
      // use sim features
      cv::Point2d fc = sim_features_coord_[i];
      features_coord.push_back(fc);
      std::cout << "new desired features "<< " ["<<fc.x<<"  " <<fc.y<<"]   ";
    }
    if(features_coord.size() != num_extracted_features_)
      ROS_WARN ("Founded features are inconsistent");
    else{
      ROS_WARN ("Founded features are ok");
      allTFcdf_.clear();
      for (size_t i = 0; i< features_coord.size(); i++){
        TFcdf.setOrigin(tf::Vector3(features_coord[i].x, features_coord[i].y, 0.0));
        TFcdf.setRotation(tf::createQuaternionFromRPY(0.0, 0.0, 0.0));
        allTFcdf_.push_back(TFcdf);
        Z_des_ = req.depth;
        res.set =true;
      }
    }
  }
  return true;
}

bool VisualFeaturesExtractor::getTFs( )
{
  tf::StampedTransform transform;
  try{
    lr_.lookupTransform("lwr_a6_link", "eye_in_hand", ros::Time(0), transform);
    TFec_.setOrigin(transform.getOrigin());
    TFec_.setRotation(transform.getRotation());
  }
  catch (tf::TransformException ex){
    ROS_ERROR("%s",ex.what());
    ros::Duration(1.0).sleep();
    return false;
  }

  try{
    lr_.lookupTransform("world", "lwr_a6_link", ros::Time(0), transform);
    TFwe_.setOrigin(transform.getOrigin());
    TFwe_.setRotation(transform.getRotation());
  }
  catch (tf::TransformException ex){
    ROS_ERROR("%s",ex.what());
    ros::Duration(1.0).sleep();
    return false;
  }
  return  true;

}

bool VisualFeaturesExtractor::getCameraParameter(
    const ros::NodeHandle &nh, const std::string &camera_name,
    sensor_msgs::CameraInfo &dst_camera_param)
{

  // Get image_width from parameter server
  int image_width;
  if (!nh.getParam(camera_name + "/image_width", image_width)){
    ROS_ERROR("Parameter image_width was not found.");
    return false;
  }
  dst_camera_param.width = image_width;

  // Get image_height from parameter server
  int image_height;
  if (!nh.getParam(camera_name + "/image_height", image_height)){
    ROS_ERROR("Parameter image_height was not found.");
    return false;
  }
  dst_camera_param.height = image_height;

  // Get camera_matrix/data from parameter server
  std::vector<double> camera_matrix_data;
  if (!nh.getParam(camera_name + "/camera_matrix/data", camera_matrix_data)){
    ROS_ERROR("Parameter camera_matrix_data was not found.");
    return false;
  }
  else if (camera_matrix_data.size() != 9){
    ROS_ERROR("Parameter camera_matrix_data size is incorect.");
    return false;
  }
  else{
    for (size_t i = 0; i < camera_matrix_data.size(); i++)
      dst_camera_param.K[i] = camera_matrix_data[i];
  }

  // Get distortion_coefficients/data from parameter server
  std::vector<double> distortion_coefficients_data;
  if (!nh.getParam(camera_name + "/distortion_coefficients/data", distortion_coefficients_data)){
    ROS_ERROR("Parameter distortion_coefficients_data was not found.");
    return false;
  }
  else if (distortion_coefficients_data.size() < 4){
    ROS_ERROR("Parameter distortion_coefficients_data size is incorect.");
    return false;
  }
  else{
    for (size_t i = 0; i < distortion_coefficients_data.size(); i++)
      dst_camera_param.D.push_back(distortion_coefficients_data[i]);
  }

  // Get projection_matrix/data from parameter server
  std::vector<double> projection_matrix_data;
  if (!nh.getParam(camera_name + "/projection_matrix/data", projection_matrix_data)){
    ROS_ERROR("Parameter projection_matrix_data was not found.");
    return false;
  }
  else if (projection_matrix_data.size() != 12){
    ROS_ERROR("Parameter projection_matrix_data size is incorect.");
    return false;
  }
  else{
    for (size_t i = 0; i < projection_matrix_data.size(); i++)
      dst_camera_param.P[i] = projection_matrix_data[i];
  }
  return true;

}


void VisualFeaturesExtractor::imageCB(
    const sensor_msgs::ImageConstPtr& msg, cv_bridge::CvImagePtr *dst_image_ptr,
    ros::Time *safety_ton, int *image_status)
{
  boost::lock_guard<boost::mutex> guard(image_cb_mutex_);
  *safety_ton = ros::Time::now();
  try{
    // transform ROS image into OpenCV image
    *dst_image_ptr = cv_bridge::toCvCopy(msg, sensor_msgs::image_encodings::BGR8);
    *image_status = 1;
  }
  catch (cv_bridge::Exception& e){
    // throw an error msg. if conversion fails
    ROS_ERROR("cv_bridge exception: %s", e.what());
    *image_status = 2;
    return;
  }
}

void VisualFeaturesExtractor::findBlobsContours(const cv::Mat &srs_image,
                                                std::vector<std::vector<cv::Point> >  &dst_contours,
                                                std::vector<std::string> &dst_found_features_names)
{

  std::vector<cv::Vec4i> hierarchy;
  cv::Mat  hsv_work ;
  cv::Mat1b mask, mask1, mask2, contour_image;

  // Use hsv for more robustness
  cv::cvtColor(srs_image, hsv_work,CV_BGR2HSV);
  cv::GaussianBlur(hsv_work, hsv_work, cv::Size(5, 5), 1, 1);
  dst_contours.clear();
  mask_image_.release();
  dst_found_features_names.clear();

  for (size_t i = 0; i< hue_min_limits_.size(); i++){

    // Extract colored blob
    if (hue_min_limits_[i] < hue_max_limits_[i])
      cv::inRange(hsv_work, cv::Scalar(hue_min_limits_[i], 50, 50), cv::Scalar(hue_max_limits_[i], 255, 255), mask);
    else{
      // Red color blobs are between 170 and 10
      cv::inRange(hsv_work, cv::Scalar(hue_min_limits_[i], 20, 20), cv::Scalar(180, 255, 255), mask1);
      cv::inRange(hsv_work, cv::Scalar(0, 50, 50), cv::Scalar(hue_max_limits_[i], 255, 255), mask1);
      mask = mask1 | mask2;
    }

    if (mask_image_.empty())
      mask.copyTo(mask_image_);
    else
      mask_image_ = mask_image_ | mask;
    mask.copyTo(contour_image);
    std::vector<std::vector<cv::Point> > tmp_contours;
    cv::findContours( contour_image, tmp_contours, hierarchy, CV_RETR_LIST, CV_CHAIN_APPROX_NONE);
    std::vector<std::vector<cv::Point> > best_contours = getBestNContours(tmp_contours, min_contour_area_threshold_);

    // Remove all week contours
    if (!best_contours.empty()){
      dst_contours.push_back(best_contours[0]);
      dst_found_features_names.push_back(features_names_[i]);
    }
  }
}

void VisualFeaturesExtractor::findArucoMarkers(
    const cv::Mat &srs_image, std::vector<aruco::Marker>  &dst_markers,
    std::vector<std::string> &founded_features_names)
{

  cv::Mat img;
  srs_image.copyTo(img);
  std::vector<aruco::Marker>  markers;
  aruco::MarkerDetector marker_detector;
  dst_markers.clear();
  founded_features_names.clear();
  marker_detector.detect(img, markers);
  // marker_detector.detect(img, markers, aruco_cam_params_, arucos_size[0], false);
  for (size_t i = 0; i < arucos_id.size(); i++) {
    for (size_t j = 0; j <  markers.size(); j++){
      if (arucos_id[i] == markers[j].id){
        founded_features_names.push_back(features_names_[i]);
        dst_markers.push_back(markers[j]);
      }
    }
  }
}

