void VisualFeaturesExtractor::simVisualFeaturesTFs()
{

  // Transform for simulation
  tf::Transform TFff;
  allTFwff_.clear();

  //top_left_features
  TFff.setOrigin(tf::Vector3( -0.040,  0.030,  0.00));
  TFff.setRotation(tf::createQuaternionFromRPY( 0.0,  0.0,  -M_PI_2));
  allTFwff_.push_back(tf::StampedTransform(TFwsf_ * TFff, ros::Time::now(), "world", "sim_features_f1"));

  //top_right_features
  TFff.setOrigin(tf::Vector3( 0.040,  0.030,  0.00));
  TFff.setRotation(tf::createQuaternionFromRPY( 0.0,  0.0,  M_PI));
  allTFwff_.push_back(tf::StampedTransform(TFwsf_ * TFff, ros::Time::now(), "world", "sim_features_f2"));

  //bottom_right_features
  if (using_symmetrical_features_)
    TFff.setOrigin(tf::Vector3( 0.040,  -0.030,  0.00));
  else
    TFff.setOrigin(tf::Vector3( 0.080,  -0.030,  0.00));
  TFff.setRotation(tf::createQuaternionFromRPY( 0.0,  0.0,  M_PI_2));
  allTFwff_.push_back(tf::StampedTransform(TFwsf_ * TFff, ros::Time::now(), "world", "sim_features_f3"));

  //bottom_left_features
  TFff.setOrigin(tf::Vector3( -0.040,  -0.030,  0.00));
  TFff.setRotation(tf::createQuaternionFromRPY( 0.0,  0.0,  0.0));
  allTFwff_.push_back(tf::StampedTransform(TFwsf_ * TFff, ros::Time::now(), "world", "sim_features_f4"));
}

void VisualFeaturesExtractor::desVisualFeaturesTFs()
{

  // Transform for simulation
  tf::Transform TF0f;
  allTFcdf_.clear();

  /// Reamark set scaling factor 1.5 for the case with hri, since setup limitations 1in the case of ics

  if (using_symmetrical_features_){
    //top_left_features
    TF0f.setOrigin(1.5*tf::Vector3( -41.5,  -31.0,  0.0));
    TF0f.setRotation(tf::createQuaternionFromRPY( 0.0,  0.0,  -M_PI_2));
    allTFcdf_.push_back(TFcdf_ * TF0f);

    //top_right_features
    TF0f.setOrigin(1.5*tf::Vector3( 40.00,  -31.0,  0.0));
    TF0f.setRotation(tf::createQuaternionFromRPY( 0.0,  0.0,  M_PI));
    allTFcdf_.push_back(TFcdf_ * TF0f);

    //bottom_right_features

    TF0f.setOrigin(1.5*tf::Vector3( 40.00,  29.5,  0.0));
    TF0f.setRotation(tf::createQuaternionFromRPY( 0.0,  0.0,  M_PI_2));
    allTFcdf_.push_back(TFcdf_ * TF0f);

    //bottom_left_features
    TF0f.setOrigin(1.5*tf::Vector3( -41.5,  29.5,  0.0));
    TF0f.setRotation(tf::createQuaternionFromRPY( 0.0,  0.0,  0.0));
    allTFcdf_.push_back(TFcdf_ * TF0f);

  }
  else{
    //top_left_features
    TF0f.setOrigin(1.5*tf::Vector3( -41.5,  -30.0,  0.0));
    TF0f.setRotation(tf::createQuaternionFromRPY( 0.0,  0.0,  -M_PI_2));
    allTFcdf_.push_back(TFcdf_ * TF0f);

    //top_right_features
    TF0f.setOrigin(1.5*tf::Vector3( 39.5,  -30.0,  0.0));
    TF0f.setRotation(tf::createQuaternionFromRPY( 0.0,  0.0,  M_PI));
    allTFcdf_.push_back(TFcdf_ * TF0f);

    //bottom_right_features
    TF0f.setOrigin(1.5*tf::Vector3( 79.9,  30.0,  0.0));
    TF0f.setRotation(tf::createQuaternionFromRPY( 0.0,  0.0,  M_PI_2));
    allTFcdf_.push_back(TFcdf_ * TF0f);

    //bottom_left_features
    TF0f.setOrigin(1.5*tf::Vector3( -41.0,  30.0,  0.0));
    TF0f.setRotation(tf::createQuaternionFromRPY( 0.0,  0.0,  0.0));
    allTFcdf_.push_back(TFcdf_ * TF0f);
  }

}

void VisualFeaturesExtractor::calcFeaturesImageCoord()
{

  TFcw_ = (TFwe_*TFec_).inverse();
  Eigen::Matrix3d K;
  Eigen::Matrix3d R;
  Eigen::Vector3d t;
  Eigen::MatrixXd Rt(3,4);

  tf::matrixTFToEigen(TFcw_.getBasis(),R);
  tf::vectorTFToEigen(TFcw_.getOrigin(), t);
  Rt.block(0,0,3,3) = R;
  Rt.block(0,3,3,1) = t;

  // set rectified camera parameters
  K  << cam_param_.P[0],  cam_param_.P[1], cam_param_.P[2],
      cam_param_.P[4],  cam_param_.P[5], cam_param_.P[6],
      cam_param_.P[8],  cam_param_.P[9], cam_param_.P[10];


  // build P with size 3x4
  Eigen::MatrixXd P = K * Rt;
  Eigen::VectorXd Xv; // Xv is with size  3x1, component Xv(2) = zv

  if (using_sim_features_){
    std::stringstream stream;
    sim_features_coord_.clear();
    for (int i = 0; i < allTFwff_.size(); i++){
      Xv = P * Eigen::Vector4d(allTFwff_[i].getOrigin().x(), allTFwff_[i].getOrigin().y(), allTFwff_[i].getOrigin().z(), 1);
      cv::Point2d fc = cv::Point2d(Xv(0)/Xv(2), Xv(1)/Xv(2));
      if (fc.x >= 0 && fc.x <cam_param_.width && fc.y >= 0 && fc.y < cam_param_.height ){
        sim_features_coord_.push_back(fc);
        stream << features_names_[i]<< fixed << setprecision(4) << " ["<<fc.x<<"  " <<fc.y<<"]   ";
      }
      else
        stream << features_names_[i]<< " [ out of FOV ]   ";
    }
    ROS_DEBUG_STREAM ("Sim features:" << stream.str() );
  }



  des_features_coord_.clear();
  std::stringstream stream;
  for (int i = 0; i < allTFcdf_.size(); i++){
    cv::Point2d fc = cv::Point2d(allTFcdf_[i].getOrigin().getX(), allTFcdf_[i].getOrigin().getY());
    if (fc.x  >= 0 && fc.x  <cam_param_.width && fc.y  >= 0 && fc.y  < cam_param_.height ){
      des_features_coord_.push_back(fc);
      stream << features_names_[i]<< fixed << setprecision(4) << " ["<<fc.x<<"  " <<fc.y<<"]   ";
    }
    else
      stream << features_names_[i]<< " [ out of FOV ]   ";
  }
  ROS_DEBUG_STREAM("Des features:" << stream.str() );
}



